import React, { Component } from 'react'
import './PokemonList.css'
import '../../App.css';
import logo from '../../logo.svg'
import Card from '@material-ui/core/Card';
import GridList from '@material-ui/core/GridList';
import GridListTile from '@material-ui/core/GridListTile';
import GridListTileBar from '@material-ui/core/GridListTileBar';
import IconButton from '@material-ui/core/IconButton';
import InfoIcon from '@material-ui/icons/Info';
import pokemonListData from '../../Component/PokemonList/PokemonListData.js';
import Pagination from '@material-ui/lab/Pagination';
import InputLabel from '@material-ui/core/InputLabel';
import MenuItem from '@material-ui/core/MenuItem';
import FormControl from '@material-ui/core/FormControl';
import Select from '@material-ui/core/Select';
import Chip from '@material-ui/core/Chip';
import Avatar from '@material-ui/core/Avatar';
import DoneIcon from '@material-ui/icons/Done';
import Fab from '@material-ui/core/Fab';
import Grow from '@material-ui/core/Grow';

/**
* @author
* @function PokemonList
**/

class PokemonList extends Component{

  constructor(props) {
    super(props);
    this.state = {
      error: null,
      abilities: []
    };
  }

    componentDidMount() {
        fetch("https://pokeapi.co/api/v2/pokemon/ditto")
        .then(res => res.json())
        .then((result) => {
          this.setState({ abilities: result.abilities })
          console.log(result.abilities);
        })
        .catch(console.log)
      }

      render() {
        const { abilities } = this.state;
        return(
              <Card className='card'>
                  <div className='header'>
                      List Pokemon
                  </div>
                  <div className='search'>
                    Ini buat search
                  </div>
                  <div className='list'>
                    <Card className='card-value'>
                    <GridList cols={4} cellHeight={180} className='gridList'>
                      <GridListTile cols={4} style={{ height: 'auto' }}>
                      </GridListTile>

                        {pokemonListData.map((tile) => (
                          <Grow in='true'>
                          <GridListTile className='gridTile' key={tile.img}>
                            <img src={logo} alt={tile.title} />
                            <GridListTileBar
                              className='gridListTileBar'
                              title={tile.title} 
                              subtitle={[
                                <Fab variant="extended" className='fab'>
                                  Navigate
                                </Fab>
                              ]}
                              actionIcon={
                                <IconButton aria-label={`info about adasdasdasda`} className='icon'>
                                  <InfoIcon />
                                </IconButton>
                              }
                            />
                        </GridListTile>
                        </Grow>
                      ))}
                    </GridList>
                    <div className='pagination'>
                      <Pagination count={11} defaultPage={6} boundaryCount={2} />
                    </div>
                    </Card>
                  </div>
              </Card>
             )

      }
}

export default PokemonList;
